import React from 'react';

const Index = () => {
    return (
        <div className="flex flex-wrap items-center justify-center mt-10">
            <div className="text-center px-4 inline-block">
                <div className="flex flex-1">
                    <img src="/img/pfp.png" className="rounded-full mr-2"></img>
                    <h1 className="text-white text-5xl font-semibold">Hello I'm, <span className="text-indigo-500 font-bold text-6xl">Kyu</span> </h1>
                </div>
            </div>
        </div>
    )
}

export default Index;
